    render() {
        return (
            <div>
                <input ref={
                    (input) => {
                        this.name = input
                    }
                } type="text" placeholder='姓名' />
                <input type="text" placeholder='年龄' />
                <button>添加</button>
                <ul>
                    <li>姓名1--年龄1</li>
                    <li>姓名2--年龄2</li>
                    <li>姓名3--年龄3</li>
                </ul>
            </div >
        )
    }
}
